import React from 'react';
import style from './Footer.module.scss';
import Card from '../Card/Card';

const Footer = () => {
	return (
		<div>
			<div className={style.footerItem}>
			<Card imgUrl={"https://cdn-icons-png.flaticon.com/512/1159/1159725.png"} title={"UI/UX Design"} des={"Free resource that will help nderstand thecv designc process and improve theroi nderstand the design process andisei impro are of vquality."} />

			</div>
		</div>
	)
}
export default Footer;
